import { Component, Input, Output, EventEmitter } from '@angular/core';
import { CommonModule } from '@angular/common';
import { IconFontComponent } from '../icon-font/icon-font.component';

export type ButtonSize = 'small' | 'medium' | 'large';
export type ButtonVariant = 'filled' | 'outlined' | 'flat' | 'link';
export type ButtonState = 'default' | 'hovered' | 'active' | 'disabled' | 'focused';

/**
 * Button Component - Bioma 2.0 Design System
 *
 * Bot칩n configurable con m칰ltiples variantes, tama침os y estados.
 * Soporta 칤conos al inicio y final, y todos los estados interactivos.
 *
 * @example
 * ```html
 * <!-- Button b치sico -->
 * <bio-button label="Click me"></bio-button>
 *
 * <!-- Button con 칤cono -->
 * <bio-button
 *   label="Agregar"
 *   [iconStart]="true"
 *   (click)="handleClick()">
 * </bio-button>
 *
 * <!-- Button outlined small -->
 * <bio-button
 *   label="Cancelar"
 *   variant="outlined"
 *   size="small">
 * </bio-button>
 * ```
 */
@Component({
  selector: 'bio-button',
  standalone: true,
  imports: [CommonModule, IconFontComponent],
  templateUrl: './button.component.html',
  styleUrls: ['./button.component.scss']
})
export class ButtonComponent {
  /**
   * Texto del bot칩n
   */
  @Input() label: string = 'Button';

  /**
   * Tama침o del bot칩n
   * - small: 40px altura
   * - medium: 48px altura (default)
   * - large: 56px altura
   */
  @Input() size: ButtonSize = 'large';

  /**
   * Variante visual del bot칩n
   * - filled: Fondo s칩lido de marca (default)
   * - outlined: Solo borde
   * - flat: Sin borde
   * - link: Estilo de enlace
   */
  @Input() variant: ButtonVariant = 'filled';

  /**
   * Estado del bot칩n (normalmente manejado autom치ticamente)
   */
  @Input() state: ButtonState = 'default';

  /**
   * Muestra 칤cono al inicio del bot칩n
   */
  @Input() iconStart: boolean = false;

  /**
   * Muestra 칤cono al final del bot칩n
   */
  @Input() iconEnd: boolean = false;

  /**
   * Nombre del 칤cono Material Symbols para iconStart
   */
  @Input() iconStartName: string = 'add';

  /**
   * Nombre del 칤cono Material Symbols para iconEnd
   */
  @Input() iconEndName: string = 'keyboard_arrow_down';

  /**
   * Deshabilita el bot칩n
   */
  @Input() disabled: boolean = false;

  /**
   * Bot칩n ocupa todo el ancho disponible
   */
  @Input() fullWidth: boolean = false;

  /**
   * Tipo de bot칩n HTML
   */
  @Input() type: 'button' | 'submit' | 'reset' = 'button';

  /**
   * Evento de click
   */
  @Output() clicked = new EventEmitter<MouseEvent>();

  /**
   * Clases CSS din치micas basadas en props
   */
  get buttonClasses(): string[] {
    return [
      'bio-button',
      `bio-button--${this.size}`,
      `bio-button--${this.variant}`,
      `bio-button--${this.state}`,
      this.fullWidth ? 'bio-button--full-width' : '',
      this.disabled ? 'bio-button--disabled' : ''
    ].filter(Boolean);
  }

  /**
   * Manejador de click
   */
  handleClick(event: MouseEvent): void {
    if (!this.disabled) {
      this.clicked.emit(event);
    }
  }

  /**
   * Manejadores de estados hover/focus/active
   */
  onMouseEnter(): void {
    if (!this.disabled && this.state === 'default') {
      this.state = 'hovered';
    }
  }

  onMouseLeave(): void {
    if (!this.disabled && this.state === 'hovered') {
      this.state = 'default';
    }
  }

  onFocus(): void {
    if (!this.disabled) {
      this.state = 'focused';
    }
  }

  onBlur(): void {
    if (!this.disabled && this.state === 'focused') {
      this.state = 'default';
    }
  }

  onMouseDown(): void {
    if (!this.disabled) {
      this.state = 'active';
    }
  }

  onMouseUp(): void {
    if (!this.disabled && this.state === 'active') {
      this.state = 'hovered';
    }
  }
}

